problem:
Given that

\begin{align*}
\frac{1}{x}+\frac{1}{y}&=5,\\
3xy+x+y&=4,
\end{align*}

compute $x^2y+xy^2$.

model_solution:
We have
\begin{align*}
\frac{1}{x}+\frac{1}{y}&=5,\\
3xy+x+y&=4.
\end{align*}
Multiplying the first equation by $x$ and the second equation by $y$, we get
\begin{align*}
x\left(\frac{1}{x}+\frac{1}{y}\right)+y\left(\frac{1}{x}+\frac{1}{y}\right)&=5x+5y,\\
3xy+x+y&=4.
\end{align*}
Subtracting the second equation from the first, we get
\begin{align*}
5x+5y-3xy-x-y&=5x+5y-3xy-x-y,\\
2x+4y&=0.
\end{align*}
Solving for $x$ and $y$, we get
\begin{align*}
x&=-2y,\\
y&=\frac{1}{2}.
\end{align*}
Substituting these values into $x^2y+xy^2$, we get
\begin{align*}
x^2y+xy^2&=\left(-2y\right)^2\cdot\frac{1}{2}+(-2y)\cdot\left(\frac{1}{2}\right)^2,\\
&=4y^2+4y\cdot\frac{1}{4},\\
&=4y^2+y,\\
&=4\cdot\left(\frac{1}{2}\right)^2+\frac{1}{2},\\
&=\boxed{\frac{9}{4}}.
\end{align*} The answer is: \frac{9}{4}

