solution:
Let the number of clowns in the parade be $c$ and the number of horses be $h$. We are looking for the value of $h$. Assuming that each clown has 2 legs and 1 head, and that each horse has 4 legs and 1 head, we can set up the following system of equations:

\begin{align*}
2c+4h &= 30 \\
c + h &= 10 \\
\end{align*}

To solve for $h$, we need to eliminate $c$ from the equations above. We can rewrite the second equation above as $c=10-h$, and substituting this into the first equation to eliminate $c$ gives $2(10-h)+4h = 30$, or $h=5$. Thus, there are $\boxed{5}$ horses in the parade.

We can find the roots of this equation by using the quadratic formula: $$x = \frac{5 \pm \sqrt{(-5)^2 - (4)(1)(9)}}{2} = \frac{5 \pm i\sqrt{11}}{2}.$$ We wish to find $(a - 1)(b - 1)$, which is \begin{align*}
\left(\frac{5 + i\sqrt{11}}{2} - 1\right)\left(\frac{5 - i\sqrt{11}}{2} - 1\right) &= \left(\frac{3 + i\sqrt{11}}{2}\right)\left(\frac{3 - i\sqrt{11}}{2}\right) \\
&= \frac{9 + 11}{4}\\
&= \boxed{5}
\end{align*}

$$\text{- OR -}$$

We wish to find $(a - 1)(b - 1) = ab - (a + b) + 1$. If $a$ and $b$ are roots of this quadratic, then Vieta's formulas give us that $ab = 9$ and $a + b = 5$. Substituting these values, we find that $(a - 1)(b - 1) = 9 - 5 + 1 = \boxed{5}$.

